		setUserTokenCookie: function(username, userid, usertoken, autoLogin) {
			var cookieConfig = {path: '/'};
			if (autoLogin) {
				var expiresDate = new Date();
				expiresDate.setTime(expiresDate.getTime() + (3 * 24 * 60 * 60 * 1000));
				cookieConfig.expires = expiresDate;
			}
			$.cookie('username', username, cookieConfig);
			$.cookie('userid', userid, cookieConfig);
			$.cookie('usertoken', usertoken, cookieConfig);
		},
